import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import { indigo } from '@material-ui/core/colors';

const useStyles = makeStyles((theme) => ({
    setting: {
        flex: 2,
        padding: 20,
    },
    titleContainer: {
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
    },
    title: {
        flexGrow: 1,
    },
    userContainer: {
        backgroundColor: indigo["A200"],
    },
}));

export default function Setting() {
    const classes = useStyles();

    return (
        <div className={classes.setting}>
            <div className={classes.titleContainer}>
                <h1 className={classes.title}>Úprava uživatele</h1>
            </div>
            <div className={classes.userContainer}>
            <div className="userShow">
                    <div className="userShowTop">
                        <img src="https://img.joomcdn.net/dace9a3da47d7d748e13af43f96344a4449c7688_original.jpeg" 
                        alt="" className="userShowImg"/>
                        <div className="userShowTopTitle">
                            <span className="userShowUsername">Anna Becker</span>
                            <span className="userShowUseTitle">Software Engineer</span>
                        </div>
                    </div>
            </div>
        </div>
    </div>
    )
}
